eval("(function() {\n\n// Kick off Ember\nCCAdmin = Ember.Application.create({\n    rootElement: '#application',\n});\n\nFixtures = Ember.Object.create({\n    letters: 'ABCDEFGHIJKLMNOPQRSTUVWXYZ'.split(''),\n    searchLimit: 15,\n    queryBy: {\n        artists: 'name',\n        songs: 'title'\n    },\n    userTypes: ['admin', 'couple', 'dj', 'guest']\n});\n\n// Components\nCCAdmin.Select2Component = Ember.TextField.extend({\n    attributeBindings: ['objectQuery', 'data', 'selectedObject', 'playlistsData', 'data-dev', 'sortedPlaylists', 'type'],\n    type: 'hidden',\n    didInsertElement: function() {\n        var self = this;\n        var items;\n        var objectQuery = this.get('objectQuery');\n        var options;\n\n        if (objectQuery === 'artists') {\n            artist = this.get('value');\n            console.log(artist);\n            options = {\n                placeholder: 'Pick an artist',\n                width: 'element',\n                query: function(query) {\n                    dpd(objectQuery).get({name: {$regex:  '(?i)' + query.term + '\\w*'}, $sort: { name: 1}}, function(result, error) {\n                        if (!Ember.isEmpty(result)) {\n                            query.callback({ results : result.map(function(item) { return { id: item.name, text: item.name }}) });\n                        } else {\n                            query.callback({ results : []});\n                        }\n\n                        if (!Ember.isNone(error)) {\n                            console.log(error);\n                        }\n                    });\n                },\n                initSelection: function(e, callback) {\n                    callback({id: artist, text: artist});\n                },\n                createSearchChoice: function(term, data) {\n                    if ($(data).filter(function() { \n                        return this.text.localeCompare(term)===0; \n                    }).length===0) {\n                        return {\n                            id : '(new)' + term,\n                            text : term\n                        }\n                    }\n                }\n            };\n        } else if (objectQuery === 'songs') {\n            options = {\n                allowClear: true,\n                width: '40%',\n                placeholder: 'Search for a song',\n                query: function(query) {\n                    dpd(objectQuery).get({ id: {$nin : self.get('data')}, displayText: {$regex:  '(?i)' + query.term + '\\w*'}}, function(result, error) {\n                        if (!Ember.isEmpty(result)) {\n                            query.callback({ results : result.map(function(item) { return { id: item.id, text: item.displayText }}) });\n                        } else {\n                            query.callback({ results : []});\n                        }\n\n                        if (!Ember.isNone(error)) {\n                            console.log(error);\n                        }\n                    });\n                }\n            }\n        } else if (objectQuery === 'playlists') {\n            items = this.get('playlistsData');\n            var sortedPlaylists = this.get('sortedPlaylists');\n            options = {\n                width: 'element',\n                tags: [],\n                query: function(query) {\n                    dpd(objectQuery).get({name: {$regex:  '(?i)' + query.term + '\\w*'}}, function(result, error) {\n                        if (!Ember.isEmpty(result)) {\n                            query.callback({ results : result.map(function(item) { return { id: item.id, text: item.name }}) });\n                        } else {\n                            query.callback({ results : []});\n                        }\n\n                        if (!Ember.isNone(error)) {\n                            console.log(error);\n                        }\n                    });\n                },\n                initSelection: function(e, callback) {\n                    callback(sortedPlaylists.map(function(pl) { return { id: pl.id, text: pl.name}}));\n                }\n            };\n        } else {\n            options = {\n                width: 'element',\n                tags: [],\n                tokenSeparators: [','],\n                dropdownCss: { display: 'none' }\n            }\n        }\n\n        this.$().select2(options).on('change', function(e) {\n            if (!Ember.isNone(e.added)) {\n                if (objectQuery === 'playlists') {\n                    self.get('playlistsData').addObject({\n                        id: e.added.id,\n                        name: e.added.text\n                    });\n                } else {\n                    self.set('selectedObject', e.added);\n                }\n            } else if (!Ember.isNone(e.removed)) {\n                if (objectQuery === 'playlists') {\n                    self.get('playlistsData').removeObject(self.get('playlistsData').findBy('id', e.removed.id));\n                } else {\n                    self.set('selectedObject', e.removed);\n                }\n            }\n        });\n\n        /*if (objectQuery === 'playlists') {\n            console.log('hereere?')\n            var $e = this.$();\n            this.$().select2('container').find('ul.select2-choices').sortable({\n                containment: 'parent',\n                start: function() { $e.select2(\"onSortStart\"); },\n                update: function() { $e.select2(\"onSortEnd\"); }\n            });\n        }*/\n    }\n});\n\n// Views\nCCAdmin.MainView = Ember.View.extend({\n    click: function(e) {\n        this.get('controller').send('clearEdits');\n    }\n});\n\n\n\nCCAdmin.MainController = Ember.ObjectController.extend({\n\n});\n\nCCAdmin.ItemsController = Ember.ArrayController.extend({\n    isNextDisabled: function() {\n        return this.get('hasNext') === false;\n    }.property('hasNext'),\n    isPrevDisabled: function() {\n        return Ember.isNone(this.get('skipValue')) || this.get('skipValue') <= 0;\n    }.property('skipValue'),\n    hasNew: function() {\n        return this.anyBy('isNew', true);\n    }.property('[]'),\n    isSortByArtist: function() {\n        return this.get('sortType') === 'artist';\n    }.property('sortType'),\n    isSortByTitle: function() {\n        return this.get('sortType') === 'title';\n    }.property('sortType')\n});\n\nCCAdmin.LetterController = Ember.ObjectController.extend({\n    isFilter: function() { \n        return this.get('parentController').get('letterFilter') === this.get('content');\n    }.property('parentController.letterFilter')\n});\n\n})();//@ sourceURL=adminApp/ccAdminApp.js")

eval("(function() {\n\nCCAdmin.SongController = Ember.ObjectController.extend({\n    displayTextEdit: function() {\n        var artist = this.get('artistEdit') || '';\n        var title = this.get('titleEdit') || '';\n\n        return Ember.isEmpty(artist) && Ember.isEmpty(title) ? '' : artist.replace('(new)', '') + ' - ' + title;\n    }.property('artistsEdit', 'titleEdit'),\n    actions: {\n        clickEdit: function() {\n            if (this.get('isNew') !== true) {\n                this.send('clearEdits');\n                this.setProperties({\n                    isEdit: true,\n                    displayTextEdit: this.get('displayText'),\n                    artistEdit: this.get('artist'),\n                    titleEdit: this.get('title'),\n                    tagsEdit: !Ember.isNone(this.get('tags')) ? this.get('tags').join(',') : ''\n                });\n            }\n        },\n        clickDone: function(addAnother) {\n            var displayTextEdit = this.get('displayTextEdit');\n            var artistEdit = this.get('artistEdit');\n            var titleEdit = this.get('titleEdit');\n            var tagsEdit = this.get('tagsEdit');\n\n            this.setProperties({\n                displayTextError: Ember.isEmpty(displayTextEdit),\n                artistError: Ember.isEmpty(artistEdit),\n                titleError: Ember.isEmpty(titleEdit),\n                doneError: Ember.isEmpty(displayTextEdit) || Ember.isEmpty(artistEdit) || Ember.isEmpty(titleEdit) ?\n                                    'You\\'re missing some info, see the red fields.' : undefined\n            });\n\n            if (!Ember.isEmpty(displayTextEdit) && !Ember.isEmpty(artistEdit) && !Ember.isEmpty(titleEdit)) {\n                var self = this;\n\n                if (addAnother === true) {\n                    $('[data-dev=\"new-btn\"]').button('loading');\n                } else {\n                    $('[data-dev=\"done-btn\"]').button('loading');\n                }\n                \n                this.setProperties({\n                    //isEdit: undefined,\n                    //isNew: undefined,\n                    displayTextError: undefined,\n                    titleError: undefined\n                });\n\n                dpd.songs.post({\n                    id: this.get('id'),\n                    displayText: displayTextEdit,\n                    artist: artistEdit,\n                    title: titleEdit,\n                    tags: !Ember.isEmpty(tagsEdit) ? tagsEdit.split(',') : []\n                }, function(result, error) {\n                    if (!Ember.isNone(error)) {\n                        console.log(error);\n                    }\n\n                    if (!Ember.isNone(result)) {\n                        self.setProperties({\n                            id: result.id,\n                            artist: result.artist,\n                            displayText: result.displayText,\n                            title: result.title,\n                            tags: result.tags,\n                            isEdit: undefined,\n                            isNew: undefined\n                        });\n                        self.get('parentController').notifyPropertyChange('[]');\n                    }\n\n                    if (addAnother === \"true\") {\n                        self.send('clickAdd');\n                    }\n                });\n            }\n        },\n        clickDelete: function(obj) {\n            var parentController = this.get('parentController');\n            dpd.songs.del(this.get('id'), function(result, error) {\n                if (!Ember.isNone(result)) {\n                    \n                    parentController.removeObject(obj);\n\n                    if (parentController.get('content').length === 0) {\n                        if (parentController.get('isNextDisabled') === false) {\n                            parentController.set('skipValue', parentController.getWithDefault('skipValue', 0) - Fixtures.get('searchLimit'));\n                            parentController.send('clickNextPage');\n                        } else if (parentController.get('isPrevDisabled') === false) {\n                            parentController.send('clickPrevPage');\n                        }\n                    }\n                }\n            });\n        }\n    }\n});\n\n})();//@ sourceURL=adminApp/ccAdminSong.js")

eval("(function() {\n\n\nCCAdmin.ArtistController = Ember.ObjectController.extend({\n    actions: {\n        clickEdit: function() {\n            if (this.get('isNew') !== true) { // To prevent weirdness when clicking on a new artist's row.\n                this.send('clearEdits');\n                this.setProperties({\n                    isEdit: true,\n                    nameEdit: this.get('name'),\n                    tagsEdit: !Ember.isNone(this.get('tags')) ? this.get('tags').join(',') : ''\n                });\n            }\n        },\n        clickDone: function(addAnother) {\n            if (Ember.isEmpty(this.get('nameEdit'))) {\n                this.setProperties({\n                    'has-error' : true,\n                    doneError : 'Artist name can not be blank'\n                });\n            } else {\n                var self = this;\n\n                dpd.artists.post({\n                    id: this.get('id'),\n                    name: this.get('nameEdit'),\n                    tags: !Ember.isEmpty(this.get('tagsEdit')) ? this.get('tagsEdit').split(',') : []\n                }, function(result, error) {\n                    if (!Ember.isNone(result)) {\n                        self.setProperties(result);\n                        self.setProperties({\n                            'has-error': undefined,\n                            isEdit: undefined,\n                            isNew: undefined,\n                        });\n                        self.parentController.notifyPropertyChange('[]');\n                        if (addAnother === \"true\") {\n                            self.send('clickAdd');\n                        }\n                    }\n\n                    if (!Ember.isNone(error)) {\n                        self.setProperties({\n                            'has-error' : true,\n                            doneError: error.message,\n                        });\n                    }\n                });\n            }\n        },\n        clickDelete: function(obj) {\n            var parentController = this.get('parentController');\n            dpd.artists.del(this.get('id'), function(result, error) {\n                if (!Ember.isNone(result)) {\n                    \n                    parentController.removeObject(obj);\n                    console.log(parentController)\n                    if (parentController.get('content').length === 0) {\n                        if (parentController.get('isNextDisabled') === false) {\n                            parentController.set('skipValue', parentController.getWithDefault('skipValue', 0) - Fixtures.get('searchLimit'));\n                            parentController.send('clickNextPage');\n                        } else if (parentController.get('isPrevDisabled') === false) {\n                            parentController.send('clickPrevPage');\n                        }\n                    }\n                }\n            });\n        }\n    }\n});\n\n})();//@ sourceURL=adminApp/ccAdminArtist.js")

eval("(function() {\n\nCCAdmin.PlaylistController = Ember.ObjectController.extend({\n    noSongsText: function() {\n        return Ember.isEmpty(this.get('songs')) ? 'No songs added yet' : undefined;\n    }.property('songs'),\n    songCount: function() {\n        return !Ember.isEmpty(this.get('songs')) ? this.get('songs').length : 0;\n    }.property('songs'),\n    songList: function() {\n        return !Ember.isEmpty(this.get('songs')) ? this.get('songs').getEach('displayText') : [];\n    }.property('songs'),\n    songIds: function() {\n        return !Ember.isEmpty(this.get('songs')) ? this.get('songs').getEach('id') : [];\n    }.property('songs'),\n    actions: {\n        clickEdit: function() {\n            if (this.get('isNew') !== true) {\n                this.send('clearEdits');\n                this.setProperties({\n                    isEdit: true,\n                    displayTextEdit: this.get('displayText'),\n                    nameEdit: this.get('name'),\n                    tagsEdit: !Ember.isNone(this.get('tags')) ? this.get('tags').join(',') : ''\n                });\n            }\n        },\n        clickDone: function() {\n            if (Ember.isEmpty(this.get('nameEdit'))) {\n                this.setProperties({\n                    'has-error' : true,\n                    doneError : 'Playlist name can not be blank'\n                });\n            } else {\n                var self = this;\n\n                dpd.playlists.post({\n                    id: this.get('id'),\n                    name: this.get('nameEdit'),\n                    songs: [],\n                    tags: !Ember.isEmpty(this.get('tagsEdit')) ? this.get('tagsEdit').split(',') : []\n                }, function(result, error) {\n                    if (!Ember.isNone(result)) {\n                        self.setProperties(result);\n                        self.setProperties({\n                            'has-error': undefined,\n                            isEdit: undefined,\n                            isNew: undefined,\n                        });\n                        self.parentController.notifyPropertyChange('[]');\n                    }\n\n                    if (!Ember.isNone(error)) {\n                        self.setProperties({\n                            'has-error' : true,\n                            doneError: error.message,\n                        });\n                    }\n                });\n            }\n        },\n        clickDelete: function(obj) {\n            var parentController = this.get('parentController');\n            dpd.playlists.del(this.get('id'), function(result, error) {\n                if (!Ember.isNone(result)) {\n                    \n                    parentController.removeObject(obj);\n\n                    if (parentController.get('content').length === 0) {\n                        if (parentController.get('isNextDisabled') === false) {\n                            parentController.set('skipValue', parentController.getWithDefault('skipValue', 0) - Fixtures.get('searchLimit'));\n                            parentController.send('clickNextPage');\n                        } else if (parentController.get('isPrevDisabled') === false) {\n                            parentController.send('clickPrevPage');\n                        }\n                    }\n                }\n            });\n        }\n    }\n});\n\n})();//@ sourceURL=adminApp/ccAdminPlaylist.js")

